        /* 清除浮动 */
.ks-clear:after, .clear:after {
  content: '\20';
  display: block;
  height: 0;
  clear: both;
}
.ks-clear, .clear {
  *zoom: 1;
}


.icon_lists{
  margin: 0px;
  max-height: 245px;
  background: #fff;
  overflow-x: hidden;
  overflow-y: scroll;
  padding: 8px;
  padding-top: 13px;
  padding-right: 0px;
}

.icon_lists li{
  float:left;
  width: 30px;
  height:30px;
  text-align: center;
  list-style: none !important;
}
.icon_lists .icon{
  font-size: 20px;
  line-height: 20px;
  margin: 10px 0;
  color:#333;
  -webkit-transition: font-size 0.25s ease-out 0s;
  -moz-transition: font-size 0.25s ease-out 0s;
  transition: font-size 0.25s ease-out 0s;
  cursor: pointer;
}
.icon_lists .icon:hover{
  font-size: 30px;
}
